        <div className={styles.skill}>
            <div className={styles.icon}>
                <img src="" alt=""/>
            </div>
            <span className={styles.title}>{this.props.title}</span>
            <span className={styles.description}>{this.props.description}</span>
        </div>

    );
}

export default Skill;
